ALTER TABLE `order_item`
ADD COLUMN `status`  enum('cancel','finished','ready','inprocess','ordering') NULL AFTER `quantity`;

CREATE TABLE `group_item` (
`id`  int NOT NULL AUTO_INCREMENT ,
`value`  varchar(2048) NULL ,
`type`  varchar(32) NULL ,
`created_at`  datetime NULL ,
PRIMARY KEY (`id`)
);
ALTER TABLE `group_item`
ADD COLUMN `business_id`  int NULL AFTER `type`,
ADD COLUMN `product_id`  int NULL AFTER `business_id`
ADD COLUMN `status`  enum('finished','ready','inprocess','ordering') NULL DEFAULT 'ordering' AFTER `type`;

ALTER TABLE `chiaki_production`.`chi_notification_tracking_user` CHANGE COLUMN `player_id` `player_id` text DEFAULT NULL;
ALTER TABLE `chiaki_production`.`chi_user` ADD COLUMN `device_tokens` text AFTER `last_password_changed`;


